John Payne stars as legendary pirate Barbarossa - aka Redbeard - in Raiders of the Seven Seas. Capturing a Spanish galleon almost single-handedly, Barbarossa claims haughty Contessa Alida as his own property. Engaged to marry naval officer Alfredo, Alida despises Barbarossa, but she changes her mind when she finds out what a louse Alfredo can be. All loose plot strands are neatly tied up during the swashbuckling finale, wherein Barbarossa leads an attack on Havana.


